import { useState } from 'react';
const Home = () => {
//let name = "mario";
const [blogs , setBLogs] = useState([
{title: 'my new website', body: 'lorem ipsum ...', author: 'mario', id:1},
{title: 'welcome party', body: 'lorem ipsum ...', author: 'messi', id:2},
{title: 'web dev top', body: 'lorem ipsum ...', author: 'ronaldo', id:3},
]);


  return (
    <div className="home">

      {blogs.map((blog) => (
      <div className="blog-preview" key={blog.id} >
      <h2> {blog.title} </h2>
      <p> written by { blog.author} </p>
      </div>
      ))}


    </div>
  );
}

export default Home;
